import React from 'react'
import './Footer.css';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col';

const Footer = () => {
  return (
    <div className='footer-container bg-light'>
      <Row style={{margin: 0}}>
          <Col className='footer-brand-and-logo'>
              <h2>Project Fn</h2>
          </Col>
          <Col  className='footer-quicklinks'>
              <p className='footer-heading'></p>
          </Col>
      </Row>
    </div>
  )
}

export default Footer;
